import React from 'react';
import Modal from 'react-bootstrap/Modal';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';



export default class NewProjectModal extends React.Component {
  constructor(props){
    super();

    this.state = {
      show: props.show

    }
  }

  render(){
    return(
      <Modal show={this.props.show}>
        <Modal.Header>
          <Modal.Title>New Project Form</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form>
          // Name
          <Form.Group as={Row} controlId="formProName">
              <Form.Label column sm="2">
                <small>Name:</small>
              </Form.Label>
              <Col sm="10">
                <Form.Control plaintext defaultValue="My Cool Project." />
              </Col>
            </Form.Group>
            // Desc
            <Form.Group as={Row} controlId="formProDesc">
                <Form.Label column sm="2">
                  <small>Description:</small>
                </Form.Label>
                <Col sm="10">
                  <Form.Control plaintext defaultValue="I wanna do this and this and this project." />
                </Col>
              </Form.Group>
              // Priority
              <Form.Group as={Row} controlId="formProPriority">
                <Col sm='2'>
                  <Form.Label><small>Priority:</small></Form.Label>
                </Col>
                <Col sm='10'>
                    <Form.Control as="select">
                      <option>Low</option>
                      <option>Medium</option>
                      <option>High</option>
                    </Form.Control>
                </Col>
              </Form.Group>
          </Form>
        </Modal.Body>

        <Modal.Footer>
          <Button size='sm' variant="secondary" onClick={this.props.handleModalClose}>Close</Button>
          <Button size='sm' variant="primary">Create Project</Button>
        </Modal.Footer>
      </Modal>
    )
  }
}
